function Rating_Quality(){
    return(
        <>
        <small className="quality"> Quality :

      <span className="fa fa-star checked"></span>
      <span className="fa fa-star checked"></span>
      <span className="fa fa-star checked"></span>
      <span className="fa fa-star checked"></span>
      <span className="fa fa-star"></span> 

       </small>
       <br></br>

        </>
    );
}

export default Rating_Quality;
